        "from imblearn.under_sampling import RandomUnderSampler\n",
        "from sklearn.metrics import accuracy_score\n",
        "from sklearn.ensemble import RandomForestClassifier\n",
        "\n",
        "# Initialize the RandomUnderSampler\n",
        "rus = RandomUnderSampler(random_state=42)\n",
        "\n",
        "# Apply the under-sampling to balance the data\n",
        "x_rus, y_rus = rus.fit_resample(x_new, y)\n",
        "\n",
        "# Split the under-sampled data using StratifiedKFold\n",
        "for train_index, test_index in skf.split(x_rus, y_rus):\n",
        "    x_train_rus, x_test_rus = x_rus.iloc[train_index], x_rus.iloc[test_index]\n",
        "    y_train_rus, y_test_rus = y_rus.iloc[train_index], y_rus.iloc[test_index]\n",
        "\n",
        "# Train the classifier on under-sampled data\n",
        "rus_model = RandomForestClassifier(random_state=42)\n",
        "rus_model.fit(x_train_rus, y_train_rus)\n",
        "\n",
        "# Predict and calculate accuracy on under-sampled test set\n",
        "y_pred_rus = rus_model.predict(x_test_rus)\n",
        "accuracy_rus = accuracy_score(y_test_rus, y_pred_rus)\n",
        "print(f\"Accuracy on Under-Sampled Data: {accuracy_rus}\")\n"
